import React from 'react';
// import  {GrFilter} from 'react-icons/gr';
// import {AiOutlineDown} from 'react-icons/ai';
// import filter from './Filter';
import "./Home.css";
function Home() {

  return (
    <div >
      {/* <filter/ */}
      {/* <div><div className='right'><a href='/'><span><GrFilter/><filter/></span>Filter 
<AiOutlineDown/></a></div></div> */}
<div className='hero'>

      <div class="card text-bg-dark">
  <img src="/assets/bg1.jpg" class="card-img" alt="background" height="550px"/>
  <div class="card-img-overlay d-flex flex-column justify-content-around">
    <h5 class="card-title display-3 fw-bolder mb-0">Buy and sell Goods across Organization
    </h5>
    <p class="card-text lead fs-2">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
  </div>
</div>
</div>

      {/* <div className='home' style={{color:"black"}}>
      <h1>Home</h1>
      </div> */}
    </div>
  );
}

export default Home;
